import React, { useState } from 'react';
import './App.css';

function App() {
  const [submitting, setSubmitting] = useState(false);
  const handleSubmit = event => {
    event.preventDefault();
   setSubmitting(true);

   setTimeout(() => {
     setSubmitting(false);
   }, 3000)
 }

  return(
    <div className="wrapper">
      <h1>Lorum Ipsem Lorum Ipsem Lorum Ipsem</h1>
      {submitting &&
       <div>Submtting Form...</div>
     }

      <form onSubmit={handleSubmit}>
        <fieldset>
          <label>

        <div>Investment Amount:</div>
        <span><input type="number" min="0.01"/></span>

        <div>Investment Type: <input type="text" name="type"/></div>

        <div>Total Net Worth <input type="number" min="0.01" /></div>

        <div>User Estimated Yearly Income <input type="number" min="0.01"/></div>

        <div>User Estimated Credit Score <input type="number" min="300" max="850" step="1"/></div>

          </label>
        </fieldset>
        <button type="submit">Submit</button>
      </form>
    </div>
  )
}

export default App;
